불안함을 말하면서 이 사진을 꺼내 든 이유는, 한 장면으로만 봤을 때는 다들 걱정이 없어보이지만 모두가 불안함과 걱정을 안고 살아간다는 것이다. 카페 사장님은 손님 없어서 걱정, 병원장님은 환자가 없어서 걱정, 선생님은 수강생이 늘지 않아서 걱정. 중년은 회사에서 짤릴까봐 걱정, 노년은 노후걱정. 불안함은 없앨 수 있는 감정이 아님을 깨달았다. 

내가 번 돈으로 간 여행이였고, 여행 중에는 정말 독립하고 싶다는 생각이 들었지만, 돌아와서는 ‘불안함은 없애야하는 것’이라는 생각에, 알바도 여행도 아무것도 안하고 그저 편안하고 익숙한 (집에서 역까지, 지하철로 몇 분 걸려서 가고, 모든 카페와 식당을 꿰뚫고 있는) 가로수길, 집, 부모님의 울타리에 안에서 편안함을 추구하고 있었다. 원래 나이가 들수록 겁은 더 많아지는 거라지만, 전보다 더 할 수 있는 것들이 더 많다. 그렇기에 불안은 받아들이고 인지하며 친해져야하는 감정임을 깨달았고, 비슷한 시기에 비슷한 생각을 하고 있을 나의 친구들에게 공유해주고 싶어 긴 글을 쓰게 되었다. 

어쩌면 내가 가장 크게 성장했던 경험을 힘들었다고만 생각하고 있었던 거 같다. 힘들었기에 성장할 수 있었던 거지만. 그리고, 저날 음식은 성공적이였다.";}i:199;a:1:{s:14:"comments_count";i:4;}i:200;a:1:{s:11:"likes_count";i:20;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvHTsEpCGA";}i:202;a:1:{s:5:"image";s:250:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118863237_1196133217516115_6917616804755278142_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=mKFKt28IMJ0AX9JE3Ff&oh=533f62cca5c30a7fcdb492852aece111&oe=5F7CF209";}i:203;a:1:{s:4:"type";s:7:"sidecar";}i:204;a:1:{s:8:"owner_id";i:2459322545;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2391157745369147372";}i:209;a:1:{s:10:"short_code";s:11:"CEvGUzupufs";}i:210;a:1:{s:12:"created_time";i:1599268237;}i:211;a:1:{s:7:"caption";s:113:"너무 가고싶어 다시하는
